import './App.css';
import React from 'react';

class Professores extends React.Component
{
  readProfs()
  {
    var myJson = [];
    fetch('https://docente.ifsc.edu.br/arliones.hoeller/test.json', {mode: 'no-cors'})
      .then(function(response)
      {
        if (response.ok)
        {
          myJson = response.json();
          return;
        }
        throw new Error('Network response was not ok (status: ' + response.status + ')');
      })
      .catch((error) => {
        console.log('error: ' + error);
      });

    return myJson;
    //console.log(response);
    //return [ { id:1,name:'Arliones'}, {id: 2, name:'Odilson'} ];
    //return response;
  }
  render()
  {
    var profs = this.readProfs();

    return (
      <div>
        <h1>Professores</h1>
        <ol>
          {profs.map((prof) => (
            <li key={prof.id}>{prof.name}</li>
          ))}
        </ol>
      </div>
    );
  }
}

function App() {
  return (
    <div className="App">
      <Professores/>
    </div>
  );
}

export default App;
